import React from "react";
// import { Link } from "react-router-dom";

class UserSignup extends React.Component {
  state = {
    name: "",
    email: "",
    password: ""
  };

  changeListener = e => {
    this.setState({ [e.target.name]: e.target.value }, () => {
      const { name, email, password } = this.state;

      console.log("name", name, "email", email, "pw", password);
    });
  };

  submitListener = e => {
    e.preventDefault();
    const { name, email, password } = this.state;
    fetch("http://localhost:3000/api/v1/users", {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
        Accept: "application/json"
      },
      body: JSON.stringify({
        user: {
          name: name,
          email: email,
          password: password
        }
      })
    })
      .then(r => r.json())
      .then(data => console.log(data.jwt));
  };

  render() {
    return (
      <form onSubmit={this.submitListener}>
        <label>Name</label>
        <input
          type="text"
          name="name"
          valu={this.state.name}
          onChange={this.changeListener}
        />
        <br />

        <label>Email</label>
        <input
          type="text"
          name="email"
          valu={this.state.email}
          onChange={this.changeListener}
        />
        <br />

        <label>Password</label>
        <input
          type="password"
          name="password"
          valu={this.state.password}
          onChange={this.changeListener}
        />
        <br />
        <button>Signup</button>
      </form>
    );
  }
}

export default UserSignup;
